// import './App.css';
import {BrowserRouter as Router,Routes,Route} from 'react-router-dom'
import Navbars from './navbar/navbar';
import Home from './Home/home';
import Footer from './Footer/footer'
import Contact from './'

function App() {
  return (
    <>
    <Router>
    <Navbars />      
      <Routes>
        <Route path='/' element={<Home />} />
      </Routes>
      <Footer />
    </Router>
    </>
  );
}


export default App;
